import React from 'react';

class product_info extends React.Component {
    render() {
      return (
        <div className="product_info">
          <h1>Shopping List for</h1>
          <ul>
            <li>Instagram</li>
            <li>WhatsApp</li>
            <li>Oculus</li>
          </ul>
        </div>
      );
    }
  }
  export default product_info
